import logo from './ESaTLogo.png';

function Header () {
  return (
    <header className="row">
      <div className="col-4">
        <img src={logo} className="logo" alt="logo" />
      </div>
      <div className="col subtitle">
        <p>Fullstack React Dot Net</p>
      </div>
    </header>
  );
}

export default Header;
